// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

error notOwner();

contract VotingManager {

    struct VotingInstance {
        address instanceAddress;
        string name;
    }

    address lastestVotingInstance;

    mapping(address => VotingInstance) public votingInstances;

    //To create new voting instance of voting
    function createVoting(string memory _name) external {
        
        Voting voting = new Voting(msg.sender);
        votingInstances[address(voting)] = VotingInstance(address(voting), _name);
        lastestVotingInstance = address(voting);
        
        
    }
    function getLastestVoting() public view returns (address){
        return lastestVotingInstance;
    }
}

contract Voting {

    
    address immutable contractOwner;
    bool public votingActive; //if true, voting is active and available to add candidate and vote

    constructor(address creator){

        contractOwner = creator;
        votingActive = true;
        
        
        
    }

    

    struct Voter {
        bool voted;
        uint256 votedForCandidateId;
    }
    struct Candidate{
        string name;
        uint256 voteCount;
        address[] voterAddresses;
    }

    // Define a mapping to keep track of voters
    mapping(address => Voter) voters;

    Candidate[] candidates;

    function getOwner() public view returns (address){
        return contractOwner;
    }
    

    
    /** 
    * This function is for adding a new candidate
    * @param _name for name of the Candidate
    */
    function addCandidate(string memory _name) public onlyOwner votingAvailable{
        // Check if the candidate with the provided name already exists
        for (uint256 i = 0; i < candidates.length; i++) {
            require(
                //Hash function to compare names
                keccak256(abi.encodePacked(candidates[i].name)) != keccak256(abi.encodePacked(_name)),
                "Candidate already exists"
            );
        }

        // If the candidate is unique, add it to the candidates array
        candidates.push(Candidate({
            name: _name,
            voteCount: 0,
            voterAddresses: new address[](0) // Initialize with an empty array
        }));
    }


    
    /**
    * Return a list of address of voters for the candidate id
    */
    function getVotersForCandidate(uint256 _candidateId) public view returns (address[] memory) {
        require(_candidateId < candidates.length, "Invalid candidate ID");

        Candidate storage candidate = candidates[_candidateId];
        
        // Return the array of voter addresses for the specified candidate
        return candidate.voterAddresses;
    }



    //Vote function
    function vote(uint256 _candidateId) public votingAvailable {
        // Check if the voter has already voted
        require(!voters[msg.sender].voted, "You have already voted");

        // Ensure that the candidate ID is valid
        require(_candidateId < candidates.length, "Invalid candidate ID");

        // Increment the vote count for the selected candidate
        candidates[_candidateId].voteCount++;

        candidates[_candidateId].voterAddresses.push(msg.sender);

        // Mark the voter as voted
        voters[msg.sender].voted = true;
        

    }

    function checkVoter(address _voterAddress) public view returns (bool, int256) {
        // Return a tuple containing the voter's vote status and the candidate ID they voted for
        if (voters[_voterAddress].voted) {
            return (true, int256(voters[_voterAddress].votedForCandidateId));
        } else {
            return (false, -1);
        }
    }


    function getOneCandidate(uint256 _candidateId) public view returns (string memory, uint256) {
        Candidate memory candidate = candidates[_candidateId];
        return (candidate.name, candidate.voteCount);

    }


    //This function return a list of candidates with their id and vote counts
    function getCandidateList() public view returns (uint256[] memory, string[] memory, uint256[] memory) {
        uint256[] memory indices = new uint256[](candidates.length);
        string[] memory candidateNames = new string[](candidates.length);
        uint256[] memory voteCounts = new uint256[](candidates.length);

        // Iterate through all candidates and populate the arrays
        for (uint256 i = 0; i < candidates.length; i++) {
            indices[i] = i;
            candidateNames[i] = candidates[i].name;
            voteCounts[i] = candidates[i].voteCount;
        }

        return (indices, candidateNames, voteCounts);
    }



    
    function getWinningCandidate() public view returns (string memory) {
        require(candidates.length > 0, "No candidates registered");

        uint256 maxVotes = 0;
        uint256 winningCandidateIndex;

        // Iterate through all candidates to find the one with the highest vote count
        for (uint256 i = 0; i < candidates.length; i++) {
            if (candidates[i].voteCount > maxVotes) {
                maxVotes = candidates[i].voteCount;
                winningCandidateIndex = i;
            }
        }

        // Return the name of the winning candidate
        return candidates[winningCandidateIndex].name;
    }

    function endVoting() public onlyOwner{
        votingActive = false; //voting is false and the contract cannot be added candidate and vote
    }


    modifier onlyOwner {
        require(msg.sender == contractOwner, "Sender is not owner!"); // this line first then the rest of the code
        // if(msg.sender != contractOwner) {revert notOwner();}
        _;
    }

    modifier votingAvailable {
        require(votingActive == true, "Voting has ended!");
        _;
    }

    

}

